-- ----------------------------
-- Table structure for `c_product`
-- ----------------------------
DROP TABLE IF EXISTS `c_product`;
CREATE TABLE `c_product` (
  `shangjia_common` varchar(1000) NOT NULL COMMENT '商品简介',
  `product_status` varchar(1) NOT NULL DEFAULT '1' COMMENT '商品状态',
  `version_no` int(11) DEFAULT NULL COMMENT '更新次数',
  `upd_date` date DEFAULT NULL COMMENT '更新时间',
  `add_date` date DEFAULT NULL COMMENT '注册时间',
  `price` decimal(13,0) unsigned zerofill NOT NULL COMMENT '价格',
  `company_name` varchar(50) DEFAULT NULL COMMENT '所属公司名称',
  `place` varchar(100) DEFAULT NULL COMMENT '产地',
  `product_name` varchar(100) NOT NULL COMMENT '商品名称',
  `product_id` varchar(8) NOT NULL COMMENT '商品ID',
  `cus_id` varchar(8) NOT NULL COMMENT '客户ID',
  PRIMARY KEY (`product_id`,`cus_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

