-- Table structure for `t_product`
-- ----------------------------
DROP TABLE IF EXISTS `t_product`;
CREATE TABLE `t_product` (
  `product_txm` varchar(50) NOT NULL COMMENT '品商条形码',
  `product_name` varchar(300) NOT NULL COMMENT '商品名称',
  `company_name` varchar(300) DEFAULT NULL COMMENT '属所公司名称(设计师)',
  `cus_id` varchar(8) NOT NULL COMMENT '客户（计师设）',
  `place` varchar(150) DEFAULT NULL COMMENT '产地',
  `price` decimal(13,2) DEFAULT NULL COMMENT '价格',
  `zhekou` float DEFAULT '10' COMMENT '折扣',
  `add_date` datetime DEFAULT NULL COMMENT '册注时间',
  `upd_date` datetime DEFAULT NULL COMMENT '更新时间',
  `vesion_no` int(11) DEFAULT '0' COMMENT '新更次数默认为0',
  `product_status` varchar(1) DEFAULT '1' COMMENT '产品状态1：在库2：在售9：过时',
  `shangjia_date` datetime DEFAULT NULL COMMENT '上架时间',
  `xiajia_date` datetime DEFAULT NULL COMMENT '下架时间',
  PRIMARY KEY (`product_txm`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

